import React, { useEffect, useRef } from "react";
import ReactDOM from 'react-dom/client';
import { AgChartsReact } from 'ag-charts-react';
import { useFetchOccupancyData } from "../Hooks/useFetchOccupancyData";
import { filterAndProcessData } from '../Utils/dataProcessing';


const OccupancyChart = ({ lgaName }) => {
    const rawData = useFetchOccupancyData();
    const processedData = filterAndProcessData(rawData, lgaName);

    const chartOptions = {
        data: Object.keys(processedData).map(year => ({
            name: year,
            data: processedData[year],
        })),
        series: Object.keys(processedData).map(year => ({
            type: 'line',
            xKey: 'x',
            yKey: 'y',
            title: year,
        })),
        axes: [
            { type: 'time', position: 'bottom' },
            { type: 'number', position: 'left' },
        ],
    };

    return (
        <div style={{ height: '500px' }}>
            <AgChartsReact options={chartOptions} /> {/* Using AgChartsReact directly */}
        </div>
    );


};

export default OccupancyChart;
